import "./FirstRowContain.scss";

function FirstRowContain() {
    return (
    <div className="row"> 
        <div className="sectionPhoneList"><b>Phone list</b></div>
        <a className="section-clear" id="ClearCartBox">Clear Cart</a> 
    </div> 
    );
  }

  export default FirstRowContain;
